```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import java.time.Instant
import java.time.temporal.ChronoUnit

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .getOrCreate()

    // Load the onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.read
      .textFile("onsite_data.txt")
      .map(line => line.split("\\s+"))
      .map(arr => (arr(0), arr(1).toLong))
      .toJavaRDD()

    // Load the top frequent queries
    val topQueries: Array[String] = spark.read
      .textFile("top_queries.txt")
      .collect()

    // Broadcast the top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries)

    // Calculate the hit rate
    val hitRate = onsiteData.mapPartitions(iter => {
      val cache = mutable.Map[String, (Long, Boolean)]()
      val topQueries = broadcastTopQueries.value
      iter.map { case (query, timestamp) =>
        if (topQueries.contains(query)) {
          val cacheEntry = cache.getOrElseUpdate(query, (timestamp, false))
          val isHit = cacheEntry._2 || timestamp - cacheEntry._1 <= 12 * 60 * 60 * 1000
          cache.put(query, (timestamp, isHit))
          isHit
        } else {
          false
        }
      }
    }).reduce(_ + _) / onsiteData.count()

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and the top frequent queries. It then broadcasts the top queries to all nodes in the cluster.

The job then calculates the hit rate by iterating over the onsite attributed data and checking if each query is in the top queries. If it is, the job checks if the query is in the cache and if it has been there for less than 12 hours. If it is in the cache and has been there for less than 12 hours, the job counts it as a hit. If it is not in the cache or has been there for more than 12 hours, the job counts it as a miss and adds it to the cache.

Finally, the job calculates the hit rate by dividing the number of hits by the total number of queries.

