To create a layout component with Tailwind CSS, you can use the `@variants` directive to define the variants for your component. Here's an example of how you can create a layout component with full-width and centered variants:

1. First, create a new file for your layout component, e.g. `Layout.js`.
2. In `Layout.js`, define your component using a functional component with props:
```jsx
import React from 'react';

const Layout = ({ children, variant }) => {
  const className = `w-full ${variant === 'centered' ? 'mx-auto' : ''}`;

  return (
    <div className={className}>
      {children}
    </div>
  );
};

export default Layout;
```
In this example, we're using the `className` prop to apply the appropriate Tailwind CSS classes based on the `variant` prop. The `w-full` class sets the width of the component to 100%, while the `mx-auto` class centers the component horizontally.

3. Next, define the variants for your component in your Tailwind CSS configuration file (e.g. `tailwind.config.js`):
```js
module.exports = {
  theme: {
    extend: {
      layout: ['full-width', 'centered'],
    },
  },
  variants: {
    extend: {
      layout: ['responsive'],
    },
  },
  plugins: [],
};
```
In this example, we're defining two variants for the `layout` utility: `full-width` and `centered`. We're also defining a `responsive` variant, which allows us to apply the layout variants based on the viewport size.

4. Finally, use your layout component in your application:
```jsx
import Layout from './Layout';

const App = () => {
  return (
    <Layout variant="centered">
      <h1>Hello, world!</h1>
    </Layout>
  );
};

export default App;
```
In this example, we're using the `Layout` component with the `centered` variant to center the contents of the component. You can also use the `full-width` variant to create a full-width layout.

That's it! With these steps, you should be able to create a layout component with Tailwind CSS and define variants for different layout styles.

