Creating a Chrome extension involves several steps and requires knowledge of HTML, CSS, and JavaScript. Here's a basic outline of how you can create a Chrome extension that takes screenshots of a webpage:

1. Create a new folder for your extension and create the following files inside it:
   - `manifest.json`
   - `popup.html`
   - `popup.js`
   - `background.js`

2. Add the following code to `manifest.json`:

```json
{
  "manifest_version": 2,
  "name": "Webpage Screenshot",
  "description": "This extension takes screenshots of a webpage",
  "version": "1.0",
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  },
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "permissions": [
    "activeTab",
    "<all_urls>",
    "tabs",
    "storage"
  ]
}
```

3. Add the following code to `popup.html`:

```html
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Webpage Screenshot</title>
</head>
<body>
  <button id="capture">Capture Screenshot</button>
  <script src="popup.js"></script>
</body>
</html>
```

4. Add the following code to `popup.js`:

```javascript
document.addEventListener('DOMContentLoaded', function () {
  document.getElementById('capture').addEventListener('click', function () {
    chrome.tabs.query({ active: true, currentWindow: true }, function (tabs) {
      chrome.tabs.sendMessage(tabs[0].id, { action: 'capture' });
    });
  });
});
```

5. Add the following code to `background.js`:

```javascript
chrome.runtime.onMessage.addListener(function (request, sender, sendResponse) {
  if (request.action === 'capture') {
    chrome.tabs.captureVisibleTab(null, {}, function (image) {
      var screenshotUrl = image;
      sendResponse({ screenshotUrl: screenshotUrl });
    });
  }
  return true;
});
```

6. Add an icon for your extension. You can use any 128x128 PNG image and save it as `icon.png` in your extension folder.

7. Load your extension into Chrome:
   - Open Chrome and navigate to `chrome://extensions`.
   - Enable "Developer mode" by clicking the toggle switch in the top right corner.
   - Click the "Load unpacked" button and select your extension folder.

Now, you should see your extension's icon in the Chrome toolbar. When you click on it, a popup will appear with a "Capture Screenshot" button. Clicking this button will take a screenshot of the current webpage and return the screenshot URL.

